INSERT [dbo].[Books] ([BookID], [Title], [Year], [Price], [Cover], [ISBN], [Description], [CategoryID]) VALUES (3, N'Harry Potter and the Deathly Hallows', 2009, CAST(21.50 AS Decimal(18, 2)), , N'978-0545139700', N'The brilliant, breathtaking conclusion to J.K. Rowling''s spellbinding series is not for the faint of heart--such revelations, battles, and betrayals await in Harry Potter and the Deathly Hallows that no fan will make it to the end unscathed. Luckily, Rowling has prepped loyal readers for the end of her series by doling out increasingly dark and dangerous tales of magic and mystery, shot through with lessons about honor and contempt, love and loss, and right and wrong. Fear not, you will find no spoilers in our review--to tell the plot would ruin the journey, and Harry Potter and the Deathly Hallows is an odyssey the likes of which Rowling''s fans have not yet seen, and are not likely to forget. ', 1)
GO
INSERT [dbo].[Books] ([BookID], [Title], [Year], [Price], [Cover], [ISBN], [Description], [CategoryID]) VALUES (4, N'A Brief History of Time', 1998, CAST(19.25 AS Decimal(18, 2)), , N'978-0553380163', N'A landmark volume in science writing by one of the great minds of our time, Stephen Hawkings book explores such profound questions as: How did the universe beginand what made its start possible? Does time always flow forward? Is the universe unendingor are there boundaries? Are there other dimensions in space? What will happen when it all ends?', 2)
GO
INSERT [dbo].[Books] ([BookID], [Title], [Year], [Price], [Cover], [ISBN], [Description], [CategoryID]) VALUES (5, N'Cosmos', 2013, CAST(22.00 AS Decimal(18, 2)), , N'978-0345539434', N'Cosmos is one of the bestselling science books of all time. In clear-eyed prose, Sagan reveals a jewel-like blue world inhabited by a life form that is just beginning to discover its own identity and to venture into the vast ocean of space.', 2)
GO
INSERT [dbo].[Books] ([BookID], [Title], [Year], [Price], [Cover], [ISBN], [Description], [CategoryID]) VALUES (6, N'JavaScript: The Good Parts', 2008, CAST(30.99 AS Decimal(18, 2)), , N'978-0596517748', N'Most programming languages contain good and bad parts, but JavaScript has more than its share of the bad, having been developed and released in a hurry before it could be refined. This authoritative book scrapes away these bad features to reveal a subset of JavaScript that''s more reliable, readable, and maintainable than the language as a wholea subset you can use to create truly extensible and efficient code.', 3)
GO
INSERT [dbo].[Books] ([BookID], [Title], [Year], [Price], [Cover], [ISBN], [Description], [CategoryID]) VALUES (7, N'Java: A Beginner''s Guide, Sixth Edition', 2014, CAST(32.00 AS Decimal(18, 2)), , N'978-0071809252', N'Fully updated for Java Platform, Standard Edition 8 (Java SE 8), Java: A Beginner''s Guide, Sixth Edition gets you started programming in Java right away. Bestselling programming author Herb Schildt begins with the basics, such as how to create, compile, and run a Java program.', 3)
